    public static int lengthOfLongestSubstring(String s) {
        int ans=0;
        HashSet<Character> cHashSet = new HashSet<>();
        for(int i=0;i<s.length();i++){
            cHashSet.add(s.charAt(i));
        }
        HashSet<Character> temp = new HashSet<>(cHashSet);
        int temAns =0;
        for(int i=0;i<s.length();i++){
            if(temp.contains(s.charAt(i))){
                temp.remove(s.charAt(i));
                temAns++;
            }
            else{
                if(temp.size()==0){
                    break;
                }
                i=i-temAns;
                ans = Math.max(ans,temAns);
                temp = new HashSet<>(cHashSet);
                temAns=0;
            }
        }
        return Math.max(ans,temAns);
    }

